import styled from "styled-components";
import { theme } from "../styles/Theme";

export const Dot = styled.span`
  background-color: ${theme.colors.accent};
  width: 9px;
  height: 9px;
  position: absolute;
  display: inline-block;
  border-radius: 50%;
`;
